import "../index.css"
import {useEffect,useState} from "react"
function refresh(){
    alert('Hello')
}
/*
onClick後 會去後端拉資料 顯示在前端
*/
/*
next : json Server資料 放在表單
*/ 
const List = ({data})=>{
    
    
    
    return <div className="list">
            <div>
                {data.data.map((item)=>{
                    return <option value="1" onClick={refresh}>{item.Nation}</option>
                })}
            </div>
            
    </div>     
}

export default List;
